	Сабақтарың отмена болса, оқушыларға алдын ала сабақта ескертіңдер. Жай ғана айтып 
қоймай тақтаға жазып қойыңдар.

	Барлық мәселелерді менеджерге айтып жүріңдер: кешігіп жатсаңдар, отмена болып 
жатса т.б.

	Егер мұғалімнің ноутбугынан интернетке explorer-мен кіргенде порталдың кейбір 
функциялары істемей жатса, Chrome-мен кіріңдер. Chrome – жеңіл программа және 
функциясы көп.

	Ендігі үй жұмысына балл қойғанда тек қана 0,5 немесе 1 ғана емес, 0 мен 1-дің 
арасындағы балдарды қоя беріңдер. Мысалы: 0,2; 0,4; 0,7; 0,8; 0,9 т.б.     

	Егер оқушы группаға айдың соңында жазылып, 4 сабақтан аз оқыса, онда мұғалімнің 
айлығында ол баланы есептемейміз. Ал егер 4 сабақтан көп қатысса, онда ол бала сол айда 
толық қатысқандай есептейміз. Даже 5 сабақ қатысса, 12 сабақ қатысқандай есептейміз.

	Сабақ мейрам күніне түсіп қалып, сабақ болсаған кезде оқушылардың оплаталары 
азаяды. Бізде айына кемінде 12 сабақ болуы керек (аптасына үш реттен төрт апта). Егер 
мейрам күндері 12 сабақты азайтып жатса, онда сол 12 сабақтан азайған күндерге оплата 
азаяды. 

	Диспенсердің астында шкафчик бар. Стаканчиктерді алғанда артығымен алып, сол 
шкафчикке салып қойсаңдар болады. Шкафчикке стаканчиктерді сыртындағы 
целлофандарымен салыңдар, себебі іші шаң болуы мүмкін.

	Енді оқушыларды Жаңа Жыл мейрамына қатысты сыртқа алып шықпаймыз, тек чае-
питье ұйымдастырамыз. Себебі оқушыларды сыртқа алып шығу қауіпті екен. Екі оқушы 
Медеуде аяғын ауыртып алып, үйлерінде отыр.

	Егер оқушының курсты бітіріп үлгермейтінін көрсеңдер, онда 2 группаға қатысуына 
ұсыныс беріңдер. Демек, оқушы енді аптасына 6 рет келетін болады. 

	Ұсынысты порталға енгіздік. Енді ұсыныстарды порталға енгізіп жүресіңдер.

	Кейде ата-аналар мұғаліммен сөйлесейін деп сұрайды. Сол кезде телефондарыңды 
беремін. Сыйластықпен, қорықпай сөйлесе беріңдер. Жағдайды жасырмай шын айтыңдар.
